import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MainLayout from './components/Layout/MainLayout';
import Login from './components/Login';
import Register from './components/Register';
import ProtectedRoute from './components/ProtectedRoute';
import SalesPage from './components/Sales/SalesPage';
import AddSale from './components/Sales/AddSale';
import HumansPage from './components/Humans/HumansPage';
import AddHuman from './components/Humans/AddHuman';
import SuppliersPage from './components/Suppliers/SuppliersPage';
import AddSupplier from './components/Suppliers/AddSupplier';
import SuppliersByCriteria from './components/Suppliers/SuppliersByCriteria';
import OutletsPage from './components/Outlets/OutletsPage';
import AddOutlet from './components/Outlets/AddOutlet';
import TypesOfTradingPlacesPage from './components/TypesOfTradingPlaces/TypesOfTradingPlacesPage';
import AddTypeOfTradingPlace from './components/TypesOfTradingPlaces/AddTypeOfTradingPlace';
import TypesOfHallsPage from './components/TypesOfHalls/TypesOfHallsPage';
import AddTypeOfHall from './components/TypesOfHalls/AddTypeOfHall';
import ProductsPage from './components/Products/ProductsPage';
import AddProduct from './components/Products/AddProduct';
import StaffPage from './components/Staff/StaffPage';
import AddStaff from './components/Staff/AddStaff';
import JobTypesPage from './components/JobTypes/JobTypesPage';
import AddJobType from './components/JobTypes/AddJobType';
import ItemsStockOutletsPage from './components/ItemsStockOutlets/ItemsStockOutletsPage';
import AddItemsStockOutlet from './components/ItemsStockOutlets/AddItemsStockOutlet';
import ItemsStockSuppliersPage from './components/ItemsStockSuppliers/ItemsStockSuppliersPage';
import AddItemsStockSupplier from './components/ItemsStockSuppliers/AddItemsStockSupplier';
import RequestsPage from './components/Requests/RequestsPage';
import AddRequest from './components/Requests/AddRequest';
import OrderItemsPage from './components/OrderItems/OrderItemsPage';
import AddOrderItem from './components/OrderItems/AddOrderItem';
import TransferPage from './components/Transfer/TransferPage';
import AddTransfer from './components/Transfer/AddTransfer';
import BuyersByCriteria from './components/Sales/BuyersByCriteria';
import ItemsByOutlet from './components/ItemsStockOutlets/ItemsByOutlet';
import ProductDetails from './components/ItemsStockOutlets/ProductDetails';
import SellerOutput from './components/Sales/SellerOutput';
import SellerOutputByOutlet from './components/Sales/SellerOutputByOutlet';
import ProductSales from './components/Sales/ProductSales';
import StaffSalariesByCriteria from './components/Staff/StaffSalariesByCriteria';
import DeliveriesByCriteria from './components/OrderItems/DeliveriesByCriteria';
import ProfitabilityByCriteria from './components/Outlets/ProfitabilityByCriteria';
import OrderItemsByRequest from './components/OrderItems/OrderItemsByRequest';
import BuyersOfProduct from './components/Sales/BuyersOfProduct';
import MostActiveBuyers from './components/Sales/MostActiveBuyers';
import OutletTurnover from './components/Outlets/OutletTurnover';

function App() {
    return (
        <Router>
            <MainLayout>
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <ProtectedRoute path="/" roles={['cashier', 'manager', 'owner']} element={<SalesPage />} />
                    <ProtectedRoute path="/sales" roles={['cashier', 'manager', 'owner']} element={<SalesPage />} />
                    <ProtectedRoute path="/sales/add" roles={['cashier']} element={<AddSale />} />
                    <ProtectedRoute path="/sales/edit/:id" roles={['cashier']} element={<AddSale />} />
                    <ProtectedRoute path="/humans" roles={['manager', 'owner']} element={<HumansPage />} />
                    <ProtectedRoute path="/humans/add" roles={['manager']} element={<AddHuman />} />
                    <ProtectedRoute path="/humans/edit/:id" roles={['manager']} element={<AddHuman />} />
                    <ProtectedRoute path="/suppliers" roles={['manager', 'owner']} element={<SuppliersPage />} />
                    <ProtectedRoute path="/suppliers/add" roles={['manager']} element={<AddSupplier />} />
                    <ProtectedRoute path="/suppliers/edit/:id" roles={['manager']} element={<AddSupplier />} />
                    <ProtectedRoute path="/suppliers_by_criteria" roles={['manager', 'owner']} element={<SuppliersByCriteria />} />
                    <ProtectedRoute path="/outlets" roles={['manager', 'owner']} element={<OutletsPage />} />
                    <ProtectedRoute path="/outlets/add" roles={['manager']} element={<AddOutlet />} />
                    <ProtectedRoute path="/outlets/edit/:id" roles={['manager']} element={<AddOutlet />} />
                    <ProtectedRoute path="/types_of_trading_places" roles={['manager', 'owner']} element={<TypesOfTradingPlacesPage />} />
                    <ProtectedRoute path="/types_of_trading_places/add" roles={['manager']} element={<AddTypeOfTradingPlace />} />
                    <ProtectedRoute path="/types_of_trading_places/edit/:id" roles={['manager']} element={<AddTypeOfTradingPlace />} />
                    <ProtectedRoute path="/types_of_halls" roles={['manager', 'owner']} element={<TypesOfHallsPage />} />
                    <ProtectedRoute path="/types_of_halls/add" roles={['manager']} element={<AddTypeOfHall />} />
                    <ProtectedRoute path="/types_of_halls/edit/:id" roles={['manager']} element={<AddTypeOfHall />} />
                    <ProtectedRoute path="/products" roles={['manager', 'owner']} element={<ProductsPage />} />
                    <ProtectedRoute path="/products/add" roles={['manager']} element={<AddProduct />} />
                    <ProtectedRoute path="/products/edit/:id" roles={['manager']} element={<AddProduct />} />
                    <ProtectedRoute path="/staff" roles={['manager', 'owner']} element={<StaffPage />} />
                    <ProtectedRoute path="/staff/add" roles={['manager']} element={<AddStaff />} />
                    <ProtectedRoute path="/staff/edit/:id" roles={['manager']} element={<AddStaff />} />
                    <ProtectedRoute path="/job_types" roles={['manager', 'owner']} element={<JobTypesPage />} />
                    <ProtectedRoute path="/job_types/add" roles={['manager']} element={<AddJobType />} />
                    <ProtectedRoute path="/job_types/edit/:id" roles={['manager']} element={<AddJobType />} />
                    <ProtectedRoute path="/items_stock_outlets" roles={['cashier', 'manager', 'owner']} element={<ItemsStockOutletsPage />} />
                    <ProtectedRoute path="/items_stock_outlets/add" roles={['cashier']} element={<AddItemsStockOutlet />} />
                    <ProtectedRoute path="/items_stock_outlets/edit/:id" roles={['cashier']} element={<AddItemsStockOutlet />} />
                    <ProtectedRoute path="/items_stock_suppliers" roles={['manager', 'owner']} element={<ItemsStockSuppliersPage />} />
                    <ProtectedRoute path="/items_stock_suppliers/add" roles={['manager']} element={<AddItemsStockSupplier />} />
                    <ProtectedRoute path="/items_stock_suppliers/edit/:id" roles={['manager']} element={<AddItemsStockSupplier />} />
                    <ProtectedRoute path="/requests" roles={['cashier', 'manager', 'owner']} element={<RequestsPage />} />
                    <ProtectedRoute path="/requests/add" roles={['cashier']} element={<AddRequest />} />
                    <ProtectedRoute path="/requests/edit/:id" roles={['cashier']} element={<AddRequest />} />
                    <ProtectedRoute path="/order_items" roles={['manager', 'owner']} element={<OrderItemsPage />} />
                    <ProtectedRoute path="/order_items/add" roles={['manager']} element={<AddOrderItem />} />
                    <ProtectedRoute path="/order_items/edit/:id" roles={['manager']} element={<AddOrderItem />} />
                    <ProtectedRoute path="/transfers" roles={['manager', 'owner']} element={<TransferPage />} />
                    <ProtectedRoute path="/transfers/add" roles={['manager']} element={<AddTransfer />} />
                    <ProtectedRoute path="/transfers/edit/:id" roles={['manager']} element={<AddTransfer />} />
                    <ProtectedRoute path="/buyers_by_criteria" roles={['owner']} element={<BuyersByCriteria />} />
                    <ProtectedRoute path="/items_by_outlet" roles={['cashier', 'manager', 'owner']} element={<ItemsByOutlet />} />
                    <ProtectedRoute path="/product_details" roles={['cashier', 'manager', 'owner']} element={<ProductDetails />} />
                    <ProtectedRoute path="/seller_output" roles={['cashier', 'manager', 'owner']} element={<SellerOutput />} />
                    <ProtectedRoute path="/seller_output_by_outlet" roles={['cashier', 'manager', 'owner']} element={<SellerOutputByOutlet />} />
                    <ProtectedRoute path="/product_sales" roles={['cashier', 'manager', 'owner']} element={<ProductSales />} />
                    <ProtectedRoute path="/staff_salaries" roles={['owner']} element={<StaffSalariesByCriteria />} />
                    <ProtectedRoute path="/supplier_deliveries" roles={['manager', 'owner']} element={<DeliveriesByCriteria />} />
                    <ProtectedRoute path="/profitability_by_criteria" roles={['owner']} element={<ProfitabilityByCriteria />} />
                    <ProtectedRoute path="/order_items_by_request" roles={['manager', 'owner']} element={<OrderItemsByRequest />} />
                    <ProtectedRoute path="/buyers_of_product" roles={['owner']} element={<BuyersOfProduct />} />
                    <ProtectedRoute path="/most_active_buyers" roles={['owner']} element={<MostActiveBuyers />} />
                    <ProtectedRoute path="/outlet_turnover" roles={['owner']} element={<OutletTurnover />} />
                </Routes>
            </MainLayout>
        </Router>
    );
}

export default App;
